#import "PingSourceModel.h"

@implementation PingSourceModel
+ (NSArray *)handlePingSourceData{
    NSMutableArray *muteSSRArray = [NSMutableArray array];
    NSArray *array = [[PingSourceModel sourceString] componentsSeparatedByString:@"href="];
    for (NSString *pString in array) {
        NSArray *subArray = [pString componentsSeparatedByString:@","];
        NSDictionary *ssrDic =  @{
                   @"link":subArray[0],
                   @"ip":subArray[1],
                   @"port":subArray[2],
                   @"password":subArray[3],
                   @"encryption":subArray[4],
                   @"protocol":subArray[5],
                   @"confusion":subArray[6],
                   };
        
//        ssrDic[@"link"] = subArray[0];
//        ssrDic[@"ip"] = subArray[1];
//        ssrDic[@"port"] = subArray[2];
//        ssrDic[@"password"] = subArray[3];
//        ssrDic[@"encryption"] = subArray[4];
//        ssrDic[@"protocol"] = subArray[5];
//        ssrDic[@"confusion"] = subArray[6];
        [muteSSRArray addObject:ssrDic];
        NSLog(@"pppp");
    }
    
    return [muteSSRArray copy];
}

